import React from 'react';
import YouTubeEmbed from '../../components/youtube-embed/YouTubeEmbed';
import ClassicalCheckboxes from '../../components/check-box/ClassicalCheckboxes';
import CRelatedCardList from '../../components/collection-card/CRelatedCardList';
import './ClassicalYoutubePageStyles.scss';

import { connect } from 'react-redux';


const mapStateToProps = (state) => {
	return {
		cCheckStatus: state.ccheckboxes.cCheckStatus,
		compositionInfo: state.ccardInfo.ccard_info
	}
}

const ClassicalYTpage = () => {
	return(
		<div>
			<div className='youtube_container'>
				<YouTubeEmbed />
			</div>
			<div className='ckeckbox_container'>
				<ClassicalCheckboxes />
			</div>
			<CRelatedCardList />
		</div>
	);
}


export default connect(mapStateToProps)(ClassicalYTpage);
